import { useState } from "react";
import "./App.css"
import { Link } from "react-router-dom";
 
function StudentForm(){
    const[id,SetId]=useState("")
    const[Name,SetName]=useState("")
    const[City,SetCity]=useState("")
    const[Email,SetEmail]=useState("")
    const[RollNO,SetRollNo]=useState("")
    const[Mobile,SetMobile]=useState("")
    const[Course,SetCourse]=useState("")
    const[DOJ,SetDOJ]=useState("")

    const changeId=(e)=>{
      SetId=(e.target.value)
    }

    const changeName=(e)=>{
      SetName=(e.target.value)
    }

    const changeEmail=(e)=>{
      SetEmail=(e.target.value)
    }

    const changeCity=(e)=>{
      SetCity=(e.target.value)
    }

    const changeRollNo=(e)=>{
      SetRollNo=(e.target.value)
    }

    const changeMobile=(e)=>{
      SetMobile=(e.target.value)
    }

    return(
        <div className="container" style={{"width":"600px","margin-left":"400px","padding":"10px"}}>
            <div className="card">
                <div className="card-title">
                    <h style={{"font-size":"20px","margin-left":"200px"}}><b>Student Form</b></h>
                </div>
                <div className="card-body"> 
                <form>
  <div className="mb-3">
    <label classNameName="form-label">ID</label>
    <input type="number" className="form-control" value={id} placeholder="Enter ID"  disabled/>
  </div>
  <div className="mb-3">
    <label className="form-label">Name</label>
    <input type="text" className="form-control" value={Name} placeholder="Enter Name" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">City</label>
    <input type="text" className="form-control" value={City} placeholder="Enter City" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">Email</label>
    <input type="email" className="form-control" value={Email} placeholder="Enter City" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">RollNO</label>
    <input type="number" className="form-control" value={RollNO} placeholder="Enter Roll No" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">Mobile</label>
    <input type="number" className="form-control" value={Mobile} placeholder="Enter Mobile" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">Course</label>
    <input type="text" className="form-control" value={Course} placeholder="Enter Course" required/>
  </div>
  <div className="mb-3">
    <label className="form-label">DOJ</label>
    <input type="date" className="form-control" value={DOJ} placeholder="Enter Date of Joining" required/>
  </div>
  <button type="submit" className="btn btn-success m-5">Submit</button>
  <Link to ="/" className="btn btn-primary"> Back to StudentData</Link>
</form>
                </div>
            </div>
        </div>
       
    )
}
export default StudentForm;
